function Work1(){
  return(
    <div>
    <h2>1991 to 1998</h2>
    <p>I was ELECTRONIC, SOFTWARE AND HARDWARE ENGINEER ,worked in
    	Beijing 35th Research Institute of China Aerospace Industry Corporation,
      China. Designed microprocessor based data collection system using an Analog-to-Digital
      converter and Assembly Language
Developed and designed the H/W and F/W of a microprocessor based signal generator
Developed and tested synchronous gates for Radar system
Designed and adapted a temperature controller for Radar system
Effectively designed the H/W and F/W of Radar system power supply monitor with 8098 microprocessor circuit and PLM96 Language
Completed a time indicator which using Digitron for display.
         </p>
      </div>
    )
}
export default Work1;
